import {TopicWrapper} from '../style';

class Topic extends Component { 
  render() {
    return (
      <TopicWrapper>
        <TopicItem>
          <img src= "https://upload-images.jianshu.io/upload_images/14715425-26bc4fb42c46ae9c.png?imageMogr2/auto-orient/strip|imageView2/2/w/228/format/webp"></img>
          社会热点
        </TopicItem>

      </TopicWrapper>
    )
  }
}

export default Topic;
